import React from "react";

const FaceRecognition = ({ imageUrl }) => {
	return (
		<div className="center ma">
			<div>
				<img
					className="mt4 mb4br3 shadow-5"
					src={imageUrl}
					alt=""
					width="500px"
					height="auto"
				/>
			</div>
		</div>
	);
};

export default FaceRecognition;
